import { Box, Typography } from "@mui/material"






export const Feature = ({ title, text }) => {
    const StylesForSame = {
        color: 'white',
        textTransform: 'none'
    }
    
    return (
        <>
            <Box>
                <Typography
                    sx={StylesForSame}
                    variant="h4"

                >
                    {title}
                </Typography>

            </Box>
            <Box>
                <Typography
                    sx={StylesForSame}

                    variant="body1"
                     
                >
                    {text}
                </Typography>
            </Box>
        </>
    )
}
